To quickly share via SMS/iMessage, we’ve included some code that you can copy and paste into your own app. This is all the code you need to get users started on inviting other users!First, note that this is making an asynchronous call to Branch’s servers to generate the link and attach the information provided in the params dictionary. We highly recommend showing the user a spinner and disabling your “share” button while the link is being generated. You can either use UIActivityIndicatorView (native) or an external library like MBProgressHUD.At the top of your view controller’s implementation (.m) file, include the following:

#import <MessageUI/MessageUI.h>
#import <MessageUI/MFMailComposeViewController.h>

objective-cswiftThen be sure to indicate that your view controller conforms to MFMessageComposeViewControllerDelegate protocol. This is done by modifying the @interface line of your view controller’s implementation (.m) file.

@interface MyAppViewController () <MFMessageComposeViewControllerDelegate>

objective-cswiftThe following code should go in some method triggered by the user (such as when the user taps on a button).

NSDictionary *params = @{@"referringUsername": @"Bob",
                         @"referringUserId": @"1234"};
// ... insert code to start the spinner of your choice here ...
[[Branch getInstance] getShortURLWithParams:params
                                 andChannel:@"SMS"
                                 andFeature:@"Referral"
                                andCallback:^(NSString *url, NSError *error) {
    if (!error) {
        // Check to make sure we can send messages on this device
        if ([MFMessageComposeViewController canSendText]) {
            MFMessageComposeViewController *messageComposer =
                [[MFMessageComposeViewController alloc] init];
            // Set the contents of the SMS/iMessage -- be sure to include the URL!
            [messageComposer setBody:[NSString stringWithFormat:
                @"Check out MyApp -- use my link to get free  points: %@", url]];
            messageComposer.messageComposeDelegate = self;
            [self presentViewController:messageComposer animated:YES completion:^{
                // ... insert code to stop the spinner here
            }];
        } else {
            // ... insert code to stop the spinner here
            [[[UIAlertView alloc] initWithTitle:@"Sorry"
                                        message:@"Your device cannot send messages."
                                       delegate:nil
                              cancelButtonTitle:@"Okay"
                              otherButtonTitles:nil] show];
        }
    }
}];

objective-cswiftLastly, there is a required delegate method for the MessageComposeViewController. We provide an empty implementation, which you are free to customize.

- (void)messageComposeViewController:(MFMessageComposeViewController *)controller
                 didFinishWithResult:(MessageComposeResult)result {
    [self dismissViewControllerAnimated:YES completion:nil];
}

objective-cswiftThe above code allows you to quickly implement sharing via SMS. See the screenshot below!

// Adding text
NSString *shareString = @"Super amazing thing I want to share!";

// Adding an image
UIImage *amazingImage = [UIImage imageNamed:@"Super-Amazing-Image.png"];

// Custom data
NSMutableDictionary *params = [[NSMutableDictionary alloc] init];
[params setObject:@"Joe" forKey:@"user"];
[params setObject:@"https://s3-us-west-1.amazonaws.com/myapp/joes_pic.jpg" forKey:@"profile_pic"];
[params setObject:@"Joe likes long walks on the beach..." forKey:@"description"];
[params setObject:@"Joe's My App Referral" forKey:@"$og_title"];
[params setObject:@"https://s3-us-west-1.amazonaws.com/myapp/joes_pic.jpg" forKey:@"$og_image_url"];
[params setObject:@"Join Joe in My App - it's awesome" forKey:@"$og_description"];
[params setObject:@"http://myapp.com/desktop_splash" forKey:@"$desktop_url"];

NSArray *tags = @[@"tag1", @"tag2"];
NSString *feature = @"invite";
NSString *stage = @"2";

// Adding a link -- Branch UIActivityItemProvider
UIActivityItemProvider *itemProvider = [Branch getBranchActivityItemWithParams:params andFeature:feature andStage:stage andTags:tags];

// Pass this in the NSArray of ActivityItems when initializing a UIActivityViewController
UIActivityViewController *shareViewController = [[UIActivityViewController alloc] initWithActivityItems:@[shareString, amazingImage, itemProvider] applicationActivities:nil];

// Present the share sheet!
[self.navigationController presentViewController:shareViewController animated:YES completion:nil];

