Links are the foundation to everything Branch offers. Branch’s links offer the ability to deep link directly to content, to pass data through the install process, and to understand where users are coming from. In the case of a personalized referral system, you can attach information about the user who is sharing the link. Then this information about this user–here “John” with id “1234”–is present anytime John’s friends install the app after clicking his link.On iOS, it’s a rather simple method call.

[[Branch getInstance] getShortURLWithParams:@{@"referringUsername":@"John", @"referringUserId":@"1234"} andChannel:@"sms" andFeature:BRANCH_FEATURE_TAG_SHARE andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

