You have the ability to control the direct deep linking of each link by inserting the following optional keys in the dictionary:


      Key
      Value




      “$deeplink_path”
      The value of the deep link path that you’d like us to append to your URI. For example, you could specify “$deeplink_path”: “radio/station/456” and we’ll open the app with the URI “yourapp://radio/station/456?link_click_id=branch-identifier”. This is primarily for supporting legacy deep linking infrastructure.


