      true or false. (default is not to deep link first) This key can be specified to have our linking service force try to open the app, even if we’re not sure the user has the app installed. If the app is not installed, we fall back to the respective app store or $platform_url key. By default, we only open the app if we’ve seen a user initiate a session in your app from a Branch link (has been cookied and deep linked by Branch).

UIActivityView is the standard way of allowing users to share content from your app. A common use case is a user sharing a promo code, or a content URL with their friends. If you want to give your users a way of sharing content from your app, this is the simplest way to implement Branch.Sample UIActivityView Share SheetThe Branch iOS SDK includes a subclassed UIActivityItemProvider that can be passed into a UIActivityViewController, that will generate a Branch short URL and automatically tag it with the channel the user selects (Facebook, Twitter, etc.).You can optionally provide a delegate that conforms to the BranchActivityItemProviderDelegate which allows you to customize the content of the short url actually used to shared depending on which platform the user has chosen to share with.As mentioned in the docs, you can customize generated links to provide an $og_image_url if the user is posting to Facebook, or twitter:image if the user chose Twitter, for example.The sample app included with the Branch iOS SDK shows a sample of this in ViewController.m:MethodsObjective-C```objc
// Setup up the content you want to share, and the Branch
// params and properties, as you would for any branch link// No need to set the channel, that is done automatically based
// on the share activity the user selects
NSString *shareString = @”Super amazing thing I want to share!”;
UIImage *amazingImage = [UIImage imageNamed:@”Super-Amazing-Image.png”];NSMutableDictionary *params = [[NSMutableDictionary alloc] init];[params setObject:@”Joe” forKey:@”user”];
[params setObject:@”https://s3-us-west-1.amazonaws.com/myapp/joes_pic.jpg” forKey:@”profile_pic”];
[params setObject:@”Joe likes long walks on the beach…” forKey:@”description”];// Customize the display of the link
[params setObject:@”Joe’s My App Referral” forKey:@”$og_title”];
[params setObject:@”https://s3-us-west-1.amazonaws.com/myapp/joes_pic.jpg” forKey:@”$og_image_url”];
[params setObject:@”Join Joe in My App - it’s awesome” forKey:@”$og_description”];// Customize the redirect performance
[params setObject:@”http://myapp.com/desktop_splash” forKey:@”$desktop_url”];NSArray *tags = @[@”tag1”, @”tag2”];
NSString *feature = @”invite”;
NSString *stage = @”2”;// Branch UIActivityItemProvider
UIActivityItemProvider *itemProvider = [Branch getBranchActivityItemWithParams:params andFeature:feature andStage:stage andTags:tags];// Pass this in the NSArray of ActivityItems when initializing a UIActivityViewController
UIActivityViewController *shareViewController = [[UIActivityViewController alloc] initWithActivityItems:@[shareString, amazingImage, itemProvider] applicationActivities:nil];// Present the share sheet!
[self.navigationController presentViewController:shareViewController animated:YES completion:nil];
