ios.body:
Links are the foundation to everything Branch offers. There are many different aspects to creating links but the most important are:
  Embed key/value deep link metadata. We’ll make sure this gets delivered to the app with the clicking user
  Label feature and channel for analytics on the dashboard
Here’s how to create your own Branch Links.On iOS, it’s a rather simple method call.

[[Branch getInstance] getShortURLWithParams:@{@"foo": @"bar"} andChannel:@"sms" andFeature:BRANCH_FEATURE_TAG_SHARE andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

Branch links allow you to attach any information you want to links. Custom data can be information about an ad campaign, referring user, promotion, or content being shared. You use it to build a personalized referral system so users never see a generic onboarding screen again. You can take users straight to the content they wanted to see when they clicked the link in the first place.Imagine how URLs are used on the Internet… now you have the same power inside your native mobile apps.This data is stored on our backend and presented again when the user clicks on a link via the deepLinkHandler – it’s not simply appended to the end of the URL.   Tip: Aliasing Links
Because we don’t store data in the URL, you can create pretty links, like bnc.lt/bob. For information on custom aliases for links, see the section below, Alias – The Custom Ending.
Store data about both the sharing user and the content shared in the data dictionary. Attaching information is as simple as including a dictionary at link creation time. If, for example, James is inviting friends to check out your app, you could do the following:

[[Branch getInstance] getShortURLWithParams:@{  @"referringUsername": @"James",
                                                @"referringUserId": @"1234",
                                                @"contentId": @"0987"} andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);    
}];

objective-cswift   Tip: Identify your users!
You should identify your users so that you know who is sharing–and who is effectively driving the most installs and engagement.

If you want a breakdown of your best performing channels–whether you measure best performing by most installs, most actual signups, or any other custom events you want to track–you should specify the channel. This can be done both for Quick Links on the dashboard and for links created programmatically.On iOS, it’s a rather simple method call.

[[Branch getInstance] getShortURLWithParams:@{ @"foo": @"bar" }
                                 andChannel:@"SMS"
                                 andFeature:nil
                                andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswiftYou can safely pass in nil for any options you don’t wish to specify.

Are you a tag person? You can add as many simply tags as you want to a link. Note that these are not key-value pairs – those belong in the custom data dictionary.No mysteries here:

[[Branch getInstance] getShortURLWithParams:@{}
                                    andTags:@[@"any", @"other", @"tags", @"you", @"want"]
                                 andChannel:nil
                                 andFeature:nil
                                   andStage:nil
                                   andAlias:nil
                                andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

The more analytics the better. If you want to track whether personalized invites, content shares or gift offers are driving more installs, you can optionally specify a feature tag.By default we provide some suggestions for filling in feature when creating a link. Those are:
  share
  referral
  invite
  deal
  gift
You should feel free to specify any other “features” as you see fit.Again, the code is straightforward:

[[Branch getInstance] getShortURLWithParams:@{}
                                 andChannel:@"SMS"
                                 andFeature:@"invite"
                                andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

If you want to tailor how a link will appear on social media, you should make use of our support for Open Graph (OG) tags. You can customize the OG tags associated with the link by including key-value pairs in the params dictionary when creating a link. Note that these overwrite any defaults that you previously set on the Branch Dashboard.


      Key
      Value




      “$og_title”
      The title you’d like to appear for the link in social media


      “$og_description”
      The description you’d like to appear for the link in social media


      “$og_image_url”
      The URL for the image you’d like to appear for the link in social media


      “$og_video”
      The URL for the video


      “$og_url”
      The URL you’d like to appear


      “$og_app_id”
      Your OG app ID. Optional and rarely used.




// Facebook OG tags -- this will overwrite any defaults you set up on the Branch Dashboard
NSMutableDictionary *params = [NSMutableDictionary dictionary];
params[@"$og_title"] = @"MyApp is disrupting apps";
params[@"og_description"] = @"Out of all the apps disrupting apps, MyApp is without a doubt a leader. Check us out.";
[[Branch getInstance] getShortURLWithParams:params andCallback:^(NSString *url, NSError *error) {
   // Now we can do something with the URL...
   NSLog(@"url: %@", url);
}];

objective-cswift

Do you want prettier links – perhaps customized to the user?Utilize the appropriate short/long URL method with the parameter alias to set a custom ending. We have left the other parameters blank intentionally. You may customize them as you see fit.

[[Branch getInstance] getShortURLWithParams:nil
                                 andChannel:nil
                                 andFeature:nil
                                   andStage:nil
                                   andAlias:@"custom_ending"
                                andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

When a user doesn’t have your app and clicks a link on iOS, by default the user is taken to the App Store or Custom URL that you specified on the Dashboard’s Link Settings page. If you want to specify a different destination on a per-link basis, include a value for the $ios_url.

[[Branch getInstance] getShortURLWithParams:@{@"$ios_url": @"http://myawesomesite.com/ios-app-landing-page"} andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url)
}];

objective-cswift

When a user doesn’t have your app and clicks a link on Android, by default the user is taken to the Play Store or Custom URL that you specified on the Dashboard’s Link Settings page. If you want to specify a different destination on a per-link basis, include a value for the $android_url.

[[Branch getInstance] getShortURLWithParams:@{@"$android_url": @"http://myawesomesite.com/android-app-landing-page"} andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

When a user clicks a Branch link from a desktop, by default the user is taken to a text-me-the-app page or whichever custom page you specify on the Dashboard’s Link Settings page. If you want to specify a different web page on a per-link basis, include a value for $desktop_url.This is especially useful if you want to serve up content on the web for users who don’t have your mobile app.

[[Branch getInstance] getShortURLWithParams:@{@"$desktop_url": @"http://myawesomesite.com/content/the-desired-content"} andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

In certain cases you may want to override the default Branch behavior, which uses cookies and communication with our backend to determine whether to open an app. Branch knows that a user has the app if that user has clicked a Branch link and opened the app. This means that the first time a user clicks a Branch link, even if the app is installed, we will direct the user to the App Store.To override this behavior, you can either select “Always try to open the app” on the Dashboard, or you can specify “$always_deeplink” : “true” on a per-link basis.

[[Branch getInstance] getShortURLWithParams:@{@"$always_deeplink": @"true"} andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

The value of the deeplink path that you’d like us to append to your URI. For example, you could specify “$deeplink_path”: “radio/station/456” and we’ll open the app with the URI “yourapp://radio/station/456?link_click_id=branch-identifier”. This is primarily for supporting legacy deeplinking infrastructure.

[[Branch getInstance] getShortURLWithParams:@{@"$deeplink_path": @"radio/station/456"} andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

Routing to content is highly app-specific, since mobile apps vary widely in how they are structured. That said, we want to give a concrete example of how you can use Branch links to route straight to content within your app.Inside of the deepLinkHandler, you will want to examine the params dictionary to determine whether the user clicked on a link to content. Regardless of whether your app involves pictures, videos, text or whatever novel content your app contains, you likely have an internal system of identifiers.Let’s assume your app revolves around pictures and each one is tagged with a picture Id. When a user shares a picture, simply attach a picture Id to the Branch link being created. If a user clicks a link to a specific picture, this Id will show up in the params dictionary in the deepLinkHandler.- (BOOL)application:(UIApplication *)application
    didFinishLaunchingWithOptions:(NSDictionary *)launchOptions {

  // initialize the session, setup a deep link handler
  [[Branch getInstance] initSessionWithLaunchOptions:launchOptions
                          andRegisterDeepLinkHandler:^(NSDictionary *params, NSError *error) {

    // start setting up the view controller hierarchy
    UINavigationController *navC = (UINavigationController *)self.window.rootViewController;
    UIStoryboard *storyboard = [UIStoryboard storyboardWithName:@"Main" bundle:nil];
    UIViewController *nextVC;
    // If the key 'pictureId' is present in the deep link dictionary
    // then load the picture screen with the appropriate picture
    NSString *pictureId = [params objectForKey:@"pictureId"];
    if (pictureId) {
      nextVC = [storyboard instantiateViewControllerWithIdentifier:@"PicVC"];
      [nextVC setNextPictureId:pictureId];
    } else {
      nextVC = [storyboard instantiateViewControllerWithIdentifier:@"MainVC"];
    }
    [navC setViewControllers:@[nextVC] animated:YES];
  }];

  return YES;
}For a concrete example of giving users a customized experience via Branch links, check out our Branchster Example.

Stage is one of our lesser used options but is useful nonetheless. Useful for tracking at what stage in your app a link was created. Stage is fully determined by you and is specific to each app. Sample stages include:
  pre_signup
  mid_signup
  post_signup
  viewing_content
  on_home_screen
If your app is a game, stage could require to the user’s current level.

[[Branch getInstance] getShortURLWithParams:nil andTags:nil andChannel:nil andFeature:nil andStage:@"4" andAlias:nil andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

When we see a link click, we generate a fingerprint for users and store that fingerprint for a limited time – 2 hours by default. That browser fingerprint includes IP address, OS, OS version, etc. Then when that same user who clicked the link opens up an app with the Branch SDK, Branch creates a device fingerprint based on the same parameters and checks with the server to see if a matching browser fingerprint exists.It’s possible, albeit rare, for collisions to occur where two people on the same network have identical hardware, are running identical software, and click a link at the same time (and neithe of them have ever used an app with Branch before). One way to avoid these collisions is to shorten the time window that a browser fingerprint is stored on our servers waiting for a matching device fingerprint.You can adjust how long the browser fingerprint is stored in the browser by setting a duration when you click the link.

[[Branch getInstance] getShortURLWithParams:@{}
                                 andChannel:@"SMS"
                                 andFeature:nil
                                   andStage:nil
                           andMatchDuration:(60*60*2)
                                andCallback:^(NSString *url, NSError *error) {
    if (!error) NSLog(@"got my Branch link to share: %@", url);
}];

objective-cswift

Branch’s default behavior is to track which users refer other users. Also by default, a “referral” event is only recorded if a user who clicked on a link has never opened the app before. The first time he or she clicks a shared Branch link and opens the app, it counts as a referral.This default behavior can be overridden by modifying the initSessionWithLaunchOptions:andRegisterDeepLinkHandler: method in application:didFinishLaunchingWithOptions:. Replace the method call with the following:

[branch initSessionWithLaunchOptions:launchOptions isReferrable:@YES andRegisterDeepLinkHandler:^(NSDictionary *params, NSError *error) {     // previously initUserSessionWithCallback:withLaunchOptions:
   if (!error) {
       // This can now count as a referred session even if this isn't
       // the first time a user has opened the app (aka an "Install").
       // ... insert custom logic here ...
   }
}];

objective-cswiftYou can set isReferrable to @YES or @NO (Swift: true or false), and the behavior is as follows:

    @YES (Swift true): Now a connection can be established between a referring user and a referred user during any session, not just the very first time a user opens the app. This means that if a user signs up without clicking on a shared Branch link but later clicks on a link, the referring-referred connection is established. (In the example in part 3 below, if Bob’s friend Amy had already found and opened the app on her own but later came back to it because Bob sent her a link, Bob is the referring user and Amy is the referred user.) There can only be one referring user for any given user (e.g. as soon as Amy clicks a link from Bob, Bob is her referrer and no subsequent shared Branch links will change that). There are specific use cases where you may want this flexibility–feel free to reach out if you have questions.


    @NO (Swift false): If isReferrable is set to @NO, your app will never track the relationship between referring users and referred users. While we’re not sure why you wouldn’t want such valuable information, it is certainly an option.

Note that the default behavior when isReferrable is not set is different from both @YES and @NO. It relates the current user to a referring user ONLY for the very first open (aka “Install”).

Pre-Reqs:
Successful integration of both the Mixpanel and Branch SDKs
Methods mapped out inside apps that want to event data sent to Mixpanel
The easiest way to send event data that comes in from Branch is to invoke the Mixpanel event tracking function inside any Branch callback.In this example, we’ll take an instance of an install responsible by Branch. We let you know if an install (or referred session if a user already had the app) was caused by Branch, by examining the referred parameter.[branch initSessionWithLaunchOptions:launchOptions andRegisterDeepLinkHandler:^(NSDictionary *params, NSError *error) {
    if (!error) {
    	if ([params[@"referred"]]) {
        	// Add call here to let MP know a Branch-driven install occurred
        	[Mixpanel track:@"install" properties:params];
        }
    }
}];
Mixpanel would then receive the Branch install event, and you would know Branch is responsible because referred would equal true inside the properties argument.

Let’s say you want to take it a step further and track Branch specific installs and users inside your segments for Mixpanel. We have support for that as well. The way to leverage that would be with the following:
  After a successful Branch session, set an identity.
  Set an identity in Mixpanel
  Track events.
Since you set identity depending on your user authentication flow, we’d recommend taking care of that first. When that’s done, all you need to do is the following:[[Branch getInstance] userCompletedAction:@"purchase" withState:@{@"item":@"123-AB-456"}];
[[Mixpanel sharedInstance] track:@"purchase" properties:@{@"item":@"123-AB-456"}];

Now that you’ve added routing to your app, you can add information to the Smart Banner. If you’ve used the example Smart Banner code above, you simply need to insert any key-value pairs you’d like into the data dictionary.Using our example of routing above with the PicVC, you’d simply need to change the Web Banner code to the following:branch.banner(options, {
    phone: '9999999999',
    type: 1,
    data: {
        'pictureId': '12345',
    }
});Now when a user clicks on the Smart Banner on a mobile device, when they open your app they will be taken straight to a view controller to see picture with id “12345”. It’s that simple.Deep linking has countless possibilities and we’d be happy to brainstorm use cases for your specific app. Happy building!

