Here’s how to create your own Branch Links.JSONObject obj = new JSONObject(); obj.putString("foo", "bar");
branch.getShortUrl(obj, "sms", "share", new BranchLinkCreateListener() {
	@Override
	public void onLinkCreate(String url, BranchError error) {
		Log.i(TAG, "Ready to share my link = " + url);
	}
});

Branch links allow you to attach any information you want to links. Custom data can be information about an ad campaign, referring user, promotion, or content being shared. You use it to build a personalized referral system so users never see a generic onboarding screen again. You can take users straight to the content they wanted to see when they clicked the link in the first place.Imagine how URLs are used on the Internet… now you have the same power inside your native mobile apps.This data is stored on our backend and presented again when the user clicks on a link via the deepLinkHandler – it’s not simply appended to the end of the URL.   Tip: Aliasing Links
Because we don’t store data in the URL, you can create pretty links, like bnc.lt/bob. For information on custom aliases for links, see the section below, Alias – The Custom Ending.
Store data about both the sharing user and the content shared in the data dictionary. Attaching information is as simple as including a dictionary at link creation time. If, for example, James is inviting friends to check out your app, you could do the following:Branch.getInstance(getApplicationContext()).getShortUrl(obj, new BranchLinkCreateListener() {
	@Override
	public void onLinkCreate(String url, BranchError error) {
	    Log.i("Branch", "Got a link with custom data!");
	}
});   Tip: Identify your users!
You should identify your users so that you know who is sharing–and who is effectively driving the most installs and engagement.

If you want a breakdown of your best performing channels–whether you measure best performing by most installs, most actual signups, or any other custom events you want to track–you should specify the channel. This can be done both for Quick Links on the dashboard and for links created programmatically.In Android, you will need to use a method call that accepts a String channel type parameter, for all URL generation calls.Branch.getInstance(getApplicationContext()).getContentUrl("sms",  null, new BranchLinkCreateListener() {
    @Override
    public void onLinkCreate(String url, BranchError error) {
    }
});

Are you a tag person? You can add as many simply tags as you want to a link. Note that these are not key-value pairs – those belong in the custom data dictionary.You’ll want to use any of the getShortUrl methods that accept the paramter of type Collection<String> for tags. Check the following example:ArrayList<String> tags = new ArrayList<String>();
tags.add("tag1");
tags.add("tag2");
Branch.getInstance(getApplicationContext()).getShortUrl(tags, "channel1", null /*params dictionary */, new BranchLinkCreateListener() {
	@Override
	public void onLinkCreate(String url, BranchError error) {
		if (error == null) {
		    Log.d("MyTag", "Url = " + url);
		}
	}
});

The more analytics the better. If you want to track whether personalized invites, content shares or gift offers are driving more installs, you can optionally specify a feature tag.By default we provide some suggestions for filling in feature when creating a link. Those are:
  share
  referral
  invite
  deal
  gift
You should feel free to specify any other “features” as you see fit.Branch.getInstance(getApplicationContext()).getShortUrl("sms", "invite_feature", "", null, new BranchLinkCreateListener() {
